import { memo } from 'react';

import Img, { ImgProps } from '@/Img';

const base64 =
  'data:image/webp;base64,';

const Logo3D = memo<Omit<ImgProps, 'alt' | 'src'> & { size?: number }>(
  ({ size = '1em', style, ...rest }) => {
    return (
      <Img
        alt="lobehub"
        height={size}
        src={base64}
        style={{ flex: 'none', lineHeight: 1, ...style }}
        width={size}
        {...rest}
      />
    );
  },
);

export default Logo3D;
